import React from 'react'
import styles from './TodoInput.scss'
import classNames from 'classnames/bind';

const cx = classNames.bind(styles);

function TodoInput() {
  return (
    <div className={cx('input-content')}>
            
    </div>
  )
}

export default TodoInput;
